import styled from 'styled-components/macro'

export const CardContainer = styled.section`
background: black;
margin: 0 20px;

`

export const Card = styled.section`
  width: 40%;
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  background: blue;
  margin: 20px;
`

export const CardPreview = styled.section`
  background: white;
`
